text:
@RepJeffries just beat the record for the longest floor speech in the history of the U.S. House.

But more importantly, he told the stories of Americans who will be harmed by this Big Ugly Bill. 

In his words: we work for the American people. I will never stop fighting for you. 🇺🇸

My office is closely monitoring the traffic delays caused by downed power lines that have shut down parts of I-95 in Fredericksburg.

@VaDOT is working to resolve the issue as quickly and safely as possible.

For real-time updates on lane closures and traffic conditions, visit https://t.co/2nO1ZliAl1.
